import React from 'react';
import { useNavbar } from './NavbarContext';

function Navbar() {
    const { activePage, setActivePage } = useNavbar();

    return (
        <div className="w-screen border-b-2 border-white/10">
            <div id="navbar" className="grid grid-cols-1 gap-2 sm:gap-0 sm:grid-cols-3 pt-2 pb-2">
                <div id="logo-div" className="items-center mx-auto sm:mx-0 sm:pl-32 sm:col-span-1">
                    <img alt="logo" src="/logo.png" className="h-14 w-auto" />
                </div>
                <div id="title-div" className="flex items-center justify-center sm:col-span-1">
                    <h1 className="font-bold font-italics text-2xl">WSB ANALYTICS.</h1>
                </div>
                <div id="link-div" className="flex flex-col sm:flex-row items-center justify-between pl-2 pr-2 sm:pl-8 sm:pr-24 sm:col-span-1">
                    <NavLink href="/" activePage={activePage} setActivePage={setActivePage}>Home</NavLink>
                    <NavLink href="/analytics" activePage={activePage} setActivePage={setActivePage}>Analytics</NavLink>
                    <NavLink href="/data" activePage={activePage} setActivePage={setActivePage}>Data</NavLink>
                    <NavLink href="/how-it-works" activePage={activePage} setActivePage={setActivePage}>How it works</NavLink>
                    <NavLink href="/github" activePage={activePage} setActivePage={setActivePage}>Github</NavLink>
                </div>
            </div>
        </div>
    );
}

interface NavLinkProps {
    href: string;
    activePage: string;
    setActivePage: (page: string) => void;
}

const NavLink: React.FC<NavLinkProps> = ({ href, activePage, setActivePage, children }) => {
    const handleClick = () => {
        setActivePage(href);
    };

    return (
        <a href={href} className={`font-thin ${activePage === href && "font-bold"}`} onClick={handleClick}>
            {children}
        </a>
    );
};

export default Navbar;
